    "High Performance Low Mass Nanowire Enabled Heatpipe Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:12:03.227712",nt"name": "high-performance-low-mass-nanowire-enabled-heatpipe-project",nt"isopen":
    true,nt"url": null,nt"notes": "Illuminex Corporation proposes a NASA Phase
    I SBIR project to develop high performance, lightweight, low-profile heat pipes
    with enhanced thermal transfer properties enabled by utilizing copper nanowire arrays
    as the wick material in the heat pipe. Thermal management is a critical issue for
    advanced electronic and optical systems as current cooling techniques are being
    rapidly outpaced by the heat load of new technologies. Superior thermal control
    technologies are needed both for NASA's science spacecraft components and commercial
    products such as computers and medical lasers. The incorporation of nano-structured
    materials in heat pipe manufacturing will allow the development of thermal management
    devices with increased heat dissipation efficiency and a reduced size and weight
    profile as compared to currently utilized cooling approaches. Illuminex will develop
    processes to engineer the nanowire wick directly onto the heat pipe package, and
    using this approach, it s envisioned that heat pipe systems can be manufactured
    directly into the housings of devices requiring advanced thermal management. This
    nanotechnology enabled miniaturization can be further size reduced to near the MEMS
    level for cooling micro-electronics and sensors. Phase II will lead to full commercialization
    and manufacturing of high performance, low profile, and lightweight heat pipes.",nt"license_title":
